import './ExpenseForm.css'
import ExpenseInput from './ExpenseInput';
import ExpenseButton from './ExpenseButton';

const ExpenseForm = () => {
    const submitHandler = event => {
        event.preventDefault();
        console.log('Entered Title ' + ExpenseInput);
    }

    return (
        <form onSubmit={submitHandler}>
            <div className='new-expense__controls'>
                <div className='new-expense__control'>
                    <label>Title</label>
                    <ExpenseInputExpenseInput type='text' name='expense_label'/>
                </div>
                <div className='new-expense__control'>
                    <label>Date</label>
                    <ExpenseInput type='date' name='expense_date'/>
                </div>
                <div className='new-expense__control'>
                    <label>Amount</label>
                    <ExpenseInput type='number' name='expense_amount'/>
                </div>
                <div className='new-expense__actions'>
                    <ExpenseButton type='submit' name='expense_button' value='Add Expense'/>
                </div>
            </div>
        </form>
    )
};

export default ExpenseForm;
